package easy

import (
	"fmt"
	"testing"

	"github.com/stretchr/testify/assert"
)

func TestCheckInclusion(t *testing.T) {
	var tests = []struct {
		S1       string
		S2       string
		Expected bool
	}{
		{"ab", "eidbaooo", true},
		{"ab", "eidboaoo", false},
		{"adc", "dcda", true},
		{"abc", "bbbca", true},
		{"a", "ab", true},
		{"ccc", "cbac", false},
		{"abc", "cccccbabbbaaaa", true},
		{"abcdxabcde", "abcdeabcdx", true},
		{
			"",
			"", false,
		},
		{"vxqakfyaqahufxfizupjrkkifjlbfqfeprqrfjvxnubntdtlvz",
			"", true},
		{"",
			"", false},
	}

	for i, test := range tests {
		actual := checkInclusion(test.S1, test.S2)
		assert.Equal(t, test.Expected, actual,
			"Test Case: s1:%s s2:%s", test.S1, test.S2,
		)
		if i == 3 {
			break
		}
		fmt.Println()
	}
}
